import styled from "styled-components";

export const Footer = styled.footer`
  height: 7vh;
  background-color: #69ceff;
  padding: 0 1%;
  color: black;
  position: relative;
  bottom:0;
  left:0;
  display: flex;
  color: white;
  justify-content: center;
  align-items: center;
  padding: 2px 0;
`
